import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import Dashboard from './JS/Dashboard';
import HomePage from './JS/HomePage';
import AccountPage from './JS/AccountPage';
import AccidentReport from './JS/AccidentReport';
import ArticlesPage from './JS/ArticlesPage';
import PolicyPage from './JS/PolicyPage';
import AboutPage from './JS/AboutPage';
import LoginPage from './JS/LoginPage';
import SignupPage from './JS/SignupPage';
import ForgotPassword from './JS/ForgotPassword';

const PrivateRoute = ({ children }) => {
  const isAuthenticated = localStorage.getItem('isAuthenticated');
  return isAuthenticated ? children : <Navigate to="/login" />;
};

function App() {
  return (
    <Router>
      <Routes>
        {/* Public routes */}
        <Route path="/" element={<HomePage />} />
        <Route path="/login" element={<LoginPage />} />
        <Route path="/signup" element={<SignupPage />} />
        <Route path="/forgot-password" element={<ForgotPassword />} />

        {/* Protected routes */}
        <Route 
          path="/dashboard" 
          element={
            <PrivateRoute>
              <Dashboard />
            </PrivateRoute>
          } 
        />
        <Route 
          path="/account" 
          element={
            <PrivateRoute>
              <AccountPage />
            </PrivateRoute>
          } 
        />
        <Route 
          path="/report-accident" 
          element={
            <PrivateRoute>
              <AccidentReport />
            </PrivateRoute>
          } 
        />
        <Route 
          path="/articles" 
          element={
            <PrivateRoute>
              <ArticlesPage />
            </PrivateRoute>
          } 
        />
        <Route 
          path="/policy" 
          element={
            <PrivateRoute>
              <PolicyPage />
            </PrivateRoute>
          } 
        />
        <Route 
          path="/about" 
          element={
            <PrivateRoute>
              <AboutPage />
            </PrivateRoute>
          } 
        />
      </Routes>
    </Router>
  );
}

export default App;
